const userData = {
    userName: 'Sagar Sikchi',
    picture: '/home/hussain/Desktop/React/starter/personal_finace_manager/src/components/img/person-icon.png',
    hasPlan: true,
    income: 40000,
    plan: {
        amount: 30000,
        duration: 3,
    },
    isNewMonth: true,
    isIncomeRegular: true,
    todayExpense: [200, 10, 45, 315]
}


{/* <div class="jumbotron jumbotron-fluid">
